import styled from 'styled-components';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Title>
          Jordan Moore
        </Title>
        <ColorForm>
        <h3>Darkest: </h3>
        <input type="text" name="darkest"/>
        </ColorForm>
      </header>
    </div>
  );
}

export default App;

const Title = styled.div`
  padding: 1em;
  display: flex;
  color: var(--light2);
  font-size: 500%;
  letter-spacing: normal;
  transition: all 1s;

  :hover {
    letter-spacing: .05em;
  }
`;

const ColorForm = styled.div`
  color: var(--light1);
`;
